import "./App.css";
import Box from "./Box";
import LandingPage from "./LandingPage";

function App() {
  return (
    <div className="header">
      <h1 className="header__title">Token Generator</h1>
      <form className="form">
        <label>
          Number of blue tokens
          <input type="number" name="redNum" max="10" />
        </label>
        <label>
          Number of red tokens
          <input type="number" name="blueNum" max="10" />
        </label>
        <div className="form__button">
          <button>Clear</button>
          <button>Generate</button>
        </div>

      </form>
      <Box /> <Box />
    </div>
  );
}

export default App;
